def get_icon(name: str) -> str:
    """Return the raw SVG string for the given kebab-case icon name."""
    key = name.strip().lower()
    if key not in ICON_SVGS:
        raise KeyError("Unknown icon name: {}".format(name))
    return ICON_SVGS[key]
